_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1143086","type":"CustomJS"},{"attributes":{},"id":"1142804","type":"AllLabels"},{"attributes":{"active_drag":{"id":"1142719"},"active_scroll":{"id":"1142720"},"tools":[{"id":"1142719"},{"id":"1142720"},{"id":"1142721"},{"id":"1142722"},{"id":"1142723"},{"id":"1142724"},{"id":"1142725"},{"id":"1143084"},{"id":"1143087"}]},"id":"1142727","type":"Toolbar"},{"attributes":{"source":{"id":"1142736"}},"id":"1142927","type":"CDSView"},{"attributes":{"coordinates":null,"data_source":{"id":"1142735"},"glyph":{"id":"1142998"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1143000"},"nonselection_glyph":{"id":"1142999"},"view":{"id":"1143002"}},"id":"1143001","type":"GlyphRenderer"},{"attributes":{"format":"0.[00]%"},"id":"1142938","type":"NumeralTickFormatter"},{"attributes":{"dimensions":"width"},"id":"1142956","type":"PanTool"},{"attributes":{},"id":"1142764","type":"ResetTool"},{"attributes":{},"id":"1143073","type":"AllLabels"},{"attributes":{"fill_color":{"value":"blue"},"hatch_color":{"value":"blue"},"line_color":{"value":"blue"},"size":{"value":8},"x":{"value":1258},"y":{"value":0.10939692884999964}},"id":"1142815","type":"Scatter"},{"attributes":{"factors":["0","1"],"palette":["tomato","lime"]},"id":"1142737","type":"CategoricalColorMapper"},{"attributes":{"fill_color":"#ffffea","line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equit
